{
  static const struct install_table *t = _gimp_composite_generic;

  if (gimp_composite_generic_init ())
    {
      for (t = &_gimp_composite_generic[0]; t->function != NULL; t++)
        {
          gimp_composite_function[t->mode][t->A][t->B][t->D] = t->function;
        }
      return (TRUE);
    }

  return (FALSE);
}
